  false,\n\t\"url\": null,\n\t\"notes\": \"This agreement, a reciprocal law enforcement
  and assistance agreement, is made between the U.S. Fish and Wildlife Service and
  the County Sheriff's Department. The parties of this agreement will reciprocally
  provide emergency assistance provided that the request is based on an incident that
  is true emergency where there is a clear and present danger to human life and the
  correspondent does not have the resources at hand to bring the incident under control.
  \ This agreement will remain in effect for five years unless either party gives
  the other sixty day written notice prior to withdrawal.\",\n\t\"license_title\":
